import React, { useEffect, useMemo, useState } from 'react';
import { useSearchParams } from 'react-router-dom';
import CarCard from '../components/CarCard';
import Filters from '../components/Filters';
import { useCars } from '../state/CarsContext';

const Browse = () => {
  const { cars } = useCars();
  const [searchParams] = useSearchParams();
  const [currentPage, setCurrentPage] = useState(1);

  const PAGE_SIZE = 12;

  // Get filter parameters from URL
  const searchQuery = searchParams.get('q') || '';
  const brand = searchParams.get('brand') || '';
  const type = searchParams.get('type') || '';
  const transmission = searchParams.get('trans') || '';
  const fuel = searchParams.get('fuel') || '';
  const priceMin = parseInt(searchParams.get('pmin')) || 0;
  const priceMax = parseInt(searchParams.get('pmax')) || 10000;
  const page = parseInt(searchParams.get('page')) || 1;

  // Update current page when URL changes
  useEffect(() => {
    setCurrentPage(page);
  }, [page]);

  // Filter cars based on search and filter criteria
  const filteredCars = useMemo(() => {
    return cars.filter(car => {
      // Search query filter
      if (searchQuery) {
        const searchLower = searchQuery.toLowerCase();
        const searchableText = `${car.title} ${car.brand} ${car.type}`.toLowerCase();
        if (!searchableText.includes(searchLower)) {
          return false;
        }
      }

      // Brand filter
      if (brand && car.brand !== brand) {
        return false;
      }

      // Type filter
      if (type && car.type !== type) {
        return false;
      }

      // Transmission filter
      if (transmission && car.transmission !== transmission) {
        return false;
      }

      // Fuel filter
      if (fuel && car.fuel !== fuel) {
        return false;
      }

      // Price range filter
      if (car.pricePerDay < priceMin || car.pricePerDay > priceMax) {
        return false;
      }

      return true;
    });
  }, [cars, searchQuery, brand, type, transmission, fuel, priceMin, priceMax]);

  // Pagination
  const totalPages = Math.ceil(filteredCars.length / PAGE_SIZE);
  const startIndex = (currentPage - 1) * PAGE_SIZE;
  const endIndex = startIndex + PAGE_SIZE;
  const currentCars = filteredCars.slice(startIndex, endIndex);

  // Handle page change
  const handlePageChange = (newPage) => {
    setCurrentPage(newPage);
    const newParams = new URLSearchParams(searchParams);
    newParams.set('page', newPage.toString());
    window.history.replaceState(null, '', `?${newParams.toString()}`);
  };

  // Update page when filters change
  useEffect(() => {
    if (currentPage > totalPages && totalPages > 0) {
      handlePageChange(1);
    }
  }, [totalPages, currentPage]);

  return (
    <div className="main">
      <div className="container">
        <div className="browse-container">
          <Filters />

          <div className="results-section">
            <div className="results-header">
              <h1>Browse Cars</h1>
              <div className="results-count">
                {filteredCars.length} car{filteredCars.length !== 1 ? 's' : ''} found
              </div>
            </div>

            {searchQuery && (
              <div style={{ marginBottom: '1rem', color: 'var(--text-muted)' }}>
                Search results for: <strong>"{searchQuery}"</strong>
              </div>
            )}

            {currentCars.length > 0 ? (
              <>
                <div className="cars-grid">
                  {currentCars.map(car => (
                    <CarCard key={car.id} car={car} />
                  ))}
                </div>

                {/* Pagination */}
                {totalPages > 1 && (
                  <div className="pagination">
                    <button
                      onClick={() => handlePageChange(currentPage - 1)}
                      disabled={currentPage === 1}
                    >
                      Previous
                    </button>

                    {Array.from({ length: totalPages }, (_, i) => i + 1).map(pageNum => (
                      <button
                        key={pageNum}
                        onClick={() => handlePageChange(pageNum)}
                        className={pageNum === currentPage ? 'active' : ''}
                      >
                        {pageNum}
                      </button>
                    ))}

                    <button
                      onClick={() => handlePageChange(currentPage + 1)}
                      disabled={currentPage === totalPages}
                    >
                      Next
                    </button>
                  </div>
                )}
              </>
            ) : (
              <div className="empty-state">
                <h3>No cars found</h3>
                <p>Try adjusting your filters or search terms to find more vehicles.</p>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Browse;
